import logo from './resources/VAL_LOGO_STARTS.svg';
import './App.css'; 
//import testFirebase from './firebase/config.js';
 /*hi*/
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <object type="image/svg+xml" data={logo} className="App-logo" alt="logo" >  
        logo
        </object>
      </header>
    </div>
  );
}

//testFirebase();

export default App;
